# React CSS

## Inline Styles

Inline styles are the most basic way to style a react component. You can use the style prop to pass a JavaScript object with CSS properties to a component. For example:
```
const divStyle = {
  color: 'blue',
  fontSize: 12
};

function MyComponent() {
  return <div style={divStyle}>Hello World!</div>;
}
```
## CSS Modules

CSS Modules are a way to write CSS that is scoped to a single component. This means that you can use the same class names in different components without worrying about conflicts. To use CSS Modules, you need to create a CSS file and import it into your component. For example:
```
// my-component.css
.my-class {
  color: blue;
  font-size: 12px;
}

// my-component.js
import React from 'react';
import styles from './my-component.css';

function MyComponent() {
  return <div className={styles.myClass}>Hello World!</div>;
}
```
